css:
.highlight-view.hidden {
  display: none;
}
.editor .line.highlight-line {
  background: rgba(100, 100, 100, 0.3) !important;
}
.editor .line[class*="highlight-line-multi-line-solid-top"] {
  border-top-style: solid;
  border-top-width: 1px;
  border-top-color: #ffff00;
  margin-top: -1px;
}
.editor .line[class*="highlight-line-multi-line-solid-bottom"] {
  border-bottom-style: solid;
  border-bottom-width: 1px;
  border-bottom-color: #ffff00;
  margin-bottom: -1px;
}
.editor .line[class*="highlight-line-multi-line-dashed-top"] {
  border-top-style: dashed;
  border-top-width: 1px;
  border-top-color: #ffff00;
  margin-top: -1px;
}
.editor .line[class*="highlight-line-multi-line-dashed-bottom"] {
  border-bottom-style: dashed;
  border-bottom-width: 1px;
  border-bottom-color: #ffff00;
  margin-bottom: -1px;
}
.editor .line[class*="highlight-line-multi-line-dotted-top"] {
  border-top-style: dotted;
  border-top-width: 1px;
  border-top-color: #ffff00;
  margin-top: -1px;
}
.editor .line[class*="highlight-line-multi-line-dotted-bottom"] {
  border-bottom-style: dotted;
  border-bottom-width: 1px;
  border-bottom-color: #ffff00;
  margin-bottom: -1px;
}
